#!/usr/bin/env python3
"""
Streamy macOS App Builder
Converts Streamy Python application into a macOS .app bundle using PyInstaller.

Usage:
    python build_app.py

Output:
    Streamy-v1.5.app (in current directory)
"""

import os
import sys
import subprocess
import shutil

# Build configuration
VERSION = "1.5"
APP_NAME = f"Streamy-v{VERSION}"
MAIN_SCRIPT = "main.py"
BUNDLE_ID = "com.streamy.app"
AUTHOR = "data_heavy"
BUILD_DIR = "build_app"  # Directory for build artifacts
# Embedded icon data (base64 encoded .icns file)
ICON_DATA = """"""

def get_icon_path():
    """Extract embedded icon to temp file and return path."""
    import tempfile
    import base64
    temp_icon = os.path.join(tempfile.gettempdir(), "Streamy_temp.icns")
    with open(temp_icon, 'wb') as f:
        f.write(base64.b64decode(ICON_DATA))
    return temp_icon

ICON_FILE = None  # Will be set dynamically

def check_and_install_pyinstaller():
    """Check if PyInstaller is installed, install if missing."""
    try:
        import PyInstaller
        print(f"PyInstaller {PyInstaller.__version__} found")
        return True
    except ImportError:
        print("PyInstaller not found. Installing...")
        try:
            subprocess.check_call([sys.executable, "-m", "pip", "install", "pyinstaller"])
            print("PyInstaller installed successfully")
            return True
        except subprocess.CalledProcessError as e:
            print(f"Failed to install PyInstaller: {e}")
            print("Please install manually: pip install pyinstaller")
            return False

def clean_build_dirs():
    """Remove previous build artifacts."""
    # Remove old .app in main directory
    app_path = f"{APP_NAME}.app"
    if os.path.exists(app_path):
        print(f"Removing old app: {app_path}")
        shutil.rmtree(app_path)

    # Remove build_app folder if it exists
    if os.path.exists(BUILD_DIR):
        print(f"Removing directory: {BUILD_DIR}")
        shutil.rmtree(BUILD_DIR)

def create_spec_file():
    """Create PyInstaller spec file with macOS-specific configuration."""

    # Ensure build directory exists
    os.makedirs(BUILD_DIR, exist_ok=True)

    # Get icon from embedded data
    icon_path = get_icon_path() if ICON_DATA else None
    icon_line = f"'{icon_path}'" if icon_path else "None"

    # Get absolute path to main script
    main_script_path = os.path.abspath(MAIN_SCRIPT)

    spec_content = f'''# -*- mode: python ; coding: utf-8 -*-

block_cipher = None

a = Analysis(
    ['{main_script_path}'],
    pathex=['{os.path.abspath(".")}'],
    binaries=[],
    datas=[],
    hiddenimports=[
        'PyQt5',
        'PyQt5.QtCore',
        'PyQt5.QtGui',
        'PyQt5.QtWidgets',
        'cv2',
        'numpy',
        'websocket',
        'requests',
        'json',
        'logging',
        'threading',
        'asyncio',
        'socket',
        'dataclasses',
    ],
    hookspath=[],
    hooksconfig={{}},
    runtime_hooks=[],
    excludes=[
        'tkinter',  # Exclude tkinter since we use PyQt5
        'matplotlib',
        'scipy',
        'pandas',
    ],
    win_no_prefer_redirects=False,
    win_private_assemblies=False,
    cipher=block_cipher,
    noarchive=False,
)

# Filter out empty datas entries
a.datas = [d for d in a.datas if d[0]]

pyz = PYZ(a.pure, a.zipped_data, cipher=block_cipher)

exe = EXE(
    pyz,
    a.scripts,
    [],
    exclude_binaries=True,
    name='{APP_NAME}',
    debug=False,
    bootloader_ignore_signals=False,
    strip=False,
    upx=True,
    console=False,  # No console window
    disable_windowed_traceback=False,
    argv_emulation=True,  # macOS argv emulation
    target_arch=None,
    codesign_identity=None,
    entitlements_file=None,
)

coll = COLLECT(
    exe,
    a.binaries,
    a.zipfiles,
    a.datas,
    strip=False,
    upx=True,
    upx_exclude=[],
    name='{APP_NAME}',
)

app = BUNDLE(
    coll,
    name='{APP_NAME}.app',
    icon={icon_line},
    bundle_identifier='{BUNDLE_ID}',
    info_plist={{
        'CFBundleName': 'Streamy',
        'CFBundleDisplayName': 'Streamy',
        'CFBundleGetInfoString': 'Streamy {VERSION}',
        'CFBundleIdentifier': '{BUNDLE_ID}',
        'CFBundleVersion': '{VERSION}',
        'CFBundleShortVersionString': '{VERSION}',
        'NSHighResolutionCapable': True,
        'NSCameraUsageDescription': 'Streamy needs camera access to display printer video feed.',
        'NSLocalNetworkUsageDescription': 'Streamy needs network access to connect to your 3D printer.',
        'LSMinimumSystemVersion': '10.13.0',
    }},
)
'''

    spec_file = os.path.join(BUILD_DIR, f"{APP_NAME}.spec")
    with open(spec_file, 'w') as f:
        f.write(spec_content)

    print(f"Created spec file: {spec_file}")
    return spec_file

def build_app():
    """Build the macOS .app bundle."""
    spec_file = os.path.join(BUILD_DIR, f"{APP_NAME}.spec")

    print("\nBuilding macOS application...")
    print("=" * 50)

    try:
        subprocess.check_call([
            sys.executable, "-m", "PyInstaller",
            "--clean",
            "--noconfirm",
            "--distpath", ".",  # Output to current directory
            "--workpath", os.path.join(BUILD_DIR, "build"),
            spec_file
        ])
        return True
    except subprocess.CalledProcessError as e:
        print(f"Build failed: {e}")
        return False

def post_build_info():
    """Print post-build information and cleanup."""
    app_path = f"{APP_NAME}.app"

    if os.path.exists(app_path):
        # Get app size
        total_size = 0
        for dirpath, dirnames, filenames in os.walk(app_path):
            for f in filenames:
                fp = os.path.join(dirpath, f)
                total_size += os.path.getsize(fp)

        size_mb = total_size / (1024 * 1024)

        print("\n" + "=" * 50)
        print("BUILD SUCCESSFUL!")
        print("=" * 50)
        print(f"\nApplication: {app_path}")
        print(f"Size: {size_mb:.1f} MB")
        print("\nTo run the app:")
        print(f"  open {APP_NAME}.app")
        print("\nTo install:")
        print(f"  Drag {APP_NAME}.app to /Applications")
        print("\nTo create a DMG installer:")
        print(f"  hdiutil create -volname {APP_NAME} -srcfolder {APP_NAME}.app -ov -format UDZO {APP_NAME}.dmg")

        # Cleanup build artifacts
        print("\nCleaning up build artifacts...")
        if os.path.exists(BUILD_DIR):
            shutil.rmtree(BUILD_DIR)
            print(f"Removed {BUILD_DIR}/ directory")

        # Remove the intermediate folder PyInstaller creates
        if os.path.exists(APP_NAME):
            shutil.rmtree(APP_NAME)
            print(f"Removed {APP_NAME}/ directory")

        return True
    else:
        print("\nBuild completed but .app not found!")
        return False

def create_icon_placeholder():
    """Show icon status."""
    if ICON_DATA:
        print("\nUsing embedded app icon.")
    else:
        print("\nNote: No app icon found.")

def main():
    """Main build process."""
    print("=" * 50)
    print(f"  {APP_NAME} macOS App Builder")
    print(f"  Version {VERSION}")
    print("=" * 50)

    # Change to script directory
    script_dir = os.path.dirname(os.path.abspath(__file__))
    os.chdir(script_dir)
    print(f"\nWorking directory: {script_dir}")

    # Check for main script
    if not os.path.exists(MAIN_SCRIPT):
        print(f"Error: {MAIN_SCRIPT} not found!")
        sys.exit(1)

    # Check/install PyInstaller
    if not check_and_install_pyinstaller():
        sys.exit(1)

    # Clean previous builds
    print("\nCleaning previous build artifacts...")
    clean_build_dirs()

    # Create spec file
    print("\nCreating build configuration...")
    create_spec_file()

    # Show icon status
    create_icon_placeholder()

    # Build the app
    if build_app():
        post_build_info()
    else:
        print("\nBuild failed!")
        sys.exit(1)

if __name__ == "__main__":
    main()
